	int ret;

	if (index > 15) {
		return -EINVAL;
	}

	reg_val = ((index & 0x0F) << 4) | ((index >> 4) & 0x0F);

	if (enable) {
		reg_val |= 0x80;
	}

	ret = gpio_write(dev, HVS_GPIO_OUTPUT_EN_REG, reg_val);
	if (ret < 0) {
		return ret;
	}

	return 0;
}

